/** @jsxImportSource @emotion/react */
import { footerContainer } from './styles';
import Logo from '../../assets/logo.png';

function Footer() {
    return (
        <div css={footerContainer}>
            <img width="50" src={Logo} alt="Logo" />
            <div>:&copy </div>
        </div>
    )
}

export default Footer;
